  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of 1:1,000,000-scale
  large springs defined as where discharge is generally greater than 1,000 gallons
  per minute in Utah and most of Nevada; and greater than 200 gallons per minute in
  more arid parts of Nevada and in California. The source of this data set is sheet
  2 of a 1988 U.S. Geological Survey hydrologic investigations atlas map (Harrill
  and others, 1988.) Reference Cited Harrill, J.R., Gates, J.S., and Thomas, J.M.,
  1988, Major ground-water flow systems in the Great Basin region of Nevada, Utah,
  and adjacent states: U.S. Geological Survey Hydrologic Investigations Atlas HA-694-C,
  scale 1:1,000,000, 2 sheets.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
